import {
	AppBar,
	Box,
	Button,
	TextField,
	Toolbar,
	Typography,
} from "@mui/material";
import React from "react";

const Home = () => {
	return (
		<Box sx={{ flexGrow: 1 }}>
			<AppBar
				position="static"
				sx={{
					display: "flex",
					flexDirection: "row",
					backgroundColor: "blue",
				}}
			>
				<Toolbar
					sx={{
						flexGrow: 1,
						display: "flex",
						flexDirection: "row",
						alignItems: "center",
						justifyContent: "space-between",
					}}
				>
					<Typography variant="h6" sx={{ marginLeft: "40%" }}>
						Dog Gallery
					</Typography>
					<Button
						sx={{
							color: "white",
							backgroundColor: "green",
						}}
						variant="contained"
					>
						Custom Search
					</Button>
				</Toolbar>
			</AppBar>

			<TextField
				size="small"
				placeholder="Type here to filter by brand"
				sx={{
					marginTop: "3%",
					width: "45%",
					marginLeft: "27%",
				}}
			/>
		</Box>
	);
};

export default Home;
